import axios from "axios";

export function register({
  firstName,
  lastName,
  email,
  password,
  gender,
  dob,
  address,
  postalCode,
  phone,
  borIn,
})
{
  console.log("va");
  let role=1
  return axios.post(`${process.env.REACT_APP_BACKEND_URL}/api/accounts`, {
    firstName: firstName,
    lastName: lastName,
    email: email,
    password: password,
    gender: gender,
    DOB: dob,
    address: address,
    postalCode: postalCode,
    phone: phone,
    bornIn: borIn,
    userStatus: role
  });
}
